//O(N^2M)#define rep(i,n) for(int i=0;i<n;i++)using namespace std;typedef vector<int> vi;typedef vector<vi> mat;int extgcd(int a,int b,int &x,int &y){	int u[]={a,1,0},v[]={b,0,1};	while(*v){		int t=*u/ *v;		rep(i,3) swap(u[i]-=t*v[i],v[i]);	}	if(u[0]<0) rep(i,3) u[i]=-u[i];	x=u[1],y=u[2];	return u[0];}int inv(int a){	int x,y;	extgcd(a,mod,x,y);	if(x<0) x+=mod;	return x;}vi solve(mat a, vi b){	int H=a.size(),W=a[0].size();	bool used[MAX_H]={};	rep(j,W){		int i=0;		while(i<H&&(used[i]||(a[i][j]==0))) i++;		if(i==H) continue;		used[i]=1;		int t=a[i][j];		rep(k,W) a[i][k]=a[i][k]*inv(t)%mod;		b[i]=b[i]*inv(t)%mod;		rep(k,H) if(k!=i){			int c=-a[k][j]*inv(a[i][j])%mod;			if(c<0) c+=mod;			rep(l,W) (a[k][l]+=a[i][l]*c)%=mod;			(b[k]+=b[i]*c)%=mod;		}	}	rep(i,H) if(b[i]<0) b[i]+=mod;	return b;}